INSERT INTO `ec_reviews` VALUES (1,9,NULL,NULL,52,1.00,'Great system, great support, good job Botble. I\'m looking forward to more great functional plugins.','published','2024-06-18 23:00:45','2024-06-18 23:00:45','[\"products\\/6.jpg\",\"products\\/45.jpg\"]'),(2,3,NULL,NULL,32,5.00,'As a developer I reviewed this script. This is really awesome ecommerce script. I have convinced when I noticed that it\'s built on fully WordPress concept.','published','2024-06-18 23:00:45','2024-06-18 23:00:45','[\"products\\/18.jpg\",\"products\\/25.jpg\",\"products\\/52.jpg\"]'),(3,1,NULL,NULL,25,3.00,'It\'s not my first experience here on Codecanyon and I can honestly tell you all that Botble puts a LOT of effort into the support. They answer so fast, they helped me tons of times. REALLY by far THE BEST EXPERIENCE on Codecanyon. Those guys at Botble are so good that they deserve 5 stars. I recommend them, I trust them and I can\'t wait to see what they will sell in a near future. Thank you Botble :)','published','2024-06-18 23:00:45','2024-06-18 23:00:45','[\"products\\/19-3.jpg\",\"products\\/20-2.jpg\",\"products\\/23-3.jpg\"]'),(4,8,NULL,NULL,31,3.00,'Second or third time that I buy a Botble product, happy with the products and support. You guys do a good job :)','published','2024-06-18 23:00:45','2024-06-18 23:00:45','[\"products\\/40-1.jpg\",\"products\\/43-1.jpg\",\"products\\/50.jpg\"]'),(5,2,NULL,NULL,37,5.00,'Perfect +++++++++ i love it really also i get to fast ticket answers... Thanks Lot BOTBLE Teams','published','2024-06-18 23:00:45','2024-06-18 23:00:45','[\"products\\/23-3.jpg\"]'),(6,7,NULL,NULL,40,4.00,'The best store template! Excellent coding! Very good support! Thank you so much for all the help, I really appreciated.','published','2024-06-18 23:00:45','2024-06-18 23:00:45','[\"products\\/28-2.jpg\"]'),(7,1,NULL,NULL,13,2.00,'These guys are amazing! Responses immediately, amazing support and help... I immediately feel at ease after Purchasing..','published','2